import React, { useState } from 'react'

const AddToList = () => {
    const [input, setInput] = useState({
        name: "",
        phone: "",
        roll: "",
        work: ""
    })
    return (
        <>
            <div >
                <div> <input type="text" placeholder='name' value={input.name} /></div> <br />
                <div>  <input type="text" placeholder='Phone Number' value={input.phone} /></div> <br />
                <div>   <input type="text" placeholder='Roll Number' value={input.roll} /></div> <br />
                <div>   <textarea placeholder='Job' cols={26} value={input.work} /></div>
            </div>
        </>
    )
}

export default AddToList
